import React from "react";
import {Link} from "react-router-dom"
import "./CardVertical.css";

const CardVertical = ({product})=>{
    return (
        <div className="cardVerticalContainer">
            <Link to="/cardDetails" className="imageAndReview">
                <img src={product.img} alt="" />
            </Link>
            <div className="titleAndSubtitle">
                <h1>{product.title}</h1>
                <h2>{product.subtitle}</h2>
            </div>
            <div className="priceAndIconAdd">
                <span>${product.price}</span>
                <button className="add"><i class="fas fa-plus"></i></button>
            </div>
        </div>
    )
}
export default CardVertical;
